trailingComments.value:
*
 * 去书城（购买记录页面为空，显示去书城）
 *
 * 支持平台：书旗Android、书旗iOS、天猫Android、天猫iOS、支付宝小程序、淘宝小程序
 *
 * @returns {Promise<*>}
 *
 * @example
 * libSQ.exec('open-book-store').catch((err) => {
 *   alert(`[open-book-store][error] ${JSON.stringify(err, null, 2)}`);
 *   alert(err.detail.__$rawError__.stack);
 * });

